import React, { Component } from 'react';
import ServicesStyle from "./ServicesPage.module.css"
import ContactStyles from "../Contact/ContactPage.module.css";

class Services extends Component {
    render() {
        return (
            <div>
                You are on Services Page.
            </div>
        );
    }
}

function Header() {
    return (
        <div className={ContactStyles.headerContainer}>
            <div className={ContactStyles.header}>
                Contact Us
            </div>
        </div>
    );
}

export default Services;
